pragma solidity ^0.4.24;

interface MultiSigWalletStorageInterface {

    //보안을 위해 이 기능은 업는 것도 고려해볼만함
    function delegateDepositAddress(address target) external;

    //보안을 위해 이 기능은 업는 것도 고려해볼만함
    function delegateWithdrawAddress(address target) external;

    function isForwarder(address forwarder) external view returns(bool);

    function addForwarder(address forwarder, address client) external;

    function getEtherBalance(address forwarder) external view returns(uint256);
    function getERC20Balance(address tokenAddress, address forwarder) external view returns(uint256);

    function depositEther(address forwarder, uint256 amount) external;
    function depositERC20(address tokenAddress, address forwarder, uint256 amount) external;

    function withdrawEther(address forwarder, uint256 amount) external;
    function withdrawERC20(address tokenAddress, address forwarder, uint256 amount) external;

    event etherDeposited(address forwarder, uint256 amount);
    event ERC20Deposited(address tokenAddress, address forwarder, uint256 amount);
    event etherWithdrawed(address forwarder, uint256 amount);
    event ERC20Withdrawed(address tokenAddress, address forwarder, uint256 amount);
}
